import React from "react"
import fire from "../Fire"

var sectionStyle = {
  	position: absolute,
  	right: 0
};

class Header extends React.Component{

	constructor(props) {
        super(props);
        this.logout = this.logout.bind(this);
    }

    logout() {
        fire.auth().signOut();
    }

    render(){
		return(
			<header>
				<i className="fa fa-book fa-2x" aria-hidden="true"></i>
				<h1>Boogle</h1>
				<button style = { sectionStyle } onClick={this.logout}>Logout</button>
			</header>
		)
	}
}

export default Header
